import React, { useState } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";

function Registration(){
    const [account, setAccount] = useState({username: '', email: '', password: ''});
    let history = useHistory();
    function handleChange(e){
        const {name, value} = e.target;
        setAccount(prevState => ({
            ...prevState,
            [name]: value
         }));
    }


    function handleSubmit(e){
        e.preventDefault()
        axios
            .post("/api/register/", account)
            .then(res =>{
                history.push("/login");
                console.log(res);
            })
            .catch((error) => {
                console.log(error.response);
            });
    }

    return(
        <div>
            <form onSubmit = {handleSubmit}>
                <label>
                    Email:<br/>
                    <input type="text" value={account.email} onChange= {(e) => handleChange(e)} name = "email"/><br/>
                </label>
                <label>
                    Username:<br/>
                    <input type="text" value={account.username} onChange={(e) => handleChange(e)} name = "username"/><br/>
                </label>
                <label>
                    Password:<br/>
                    <input type="text" value={account.password} onChange={(e) => handleChange(e)} name = "password"/><br/>
                </label>
                <input type = "submit" value = "Submit"></input>
            </form>
        </div>
    );
}


export default Registration;
